import React, { Component } from 'react';


const Header = () => {
  return(
    <div>
      <h1>Ini adalah Header</h1>
    </div>
  )
}

const Footer = () => {
  return(
    <div>
      <h1>Ini adalah Footer</h1>
    </div>
  )
}

class App extends Component {
  render() {
    return(
      <div>
        <Header/>
      <h1>Hallo Azima</h1>
      <Footer/>
    </div>
    );
  }
}

export default App;
